import React,{ Component } from "react";
const { useState } =React;


class Fib extends Component {
  render() {
    return (
      fun()
    );
  }
}

function fun(){
  const[k, setValue]=useState(0);
  const handleChange = (e) => setValue(e.target.value);
  return(
    <div>
        <h2>Kalkulator n-go wyrazu ciÄ…gu Fibonacciego</h2>
        <input type="number" value={k} onChange={handleChange}/><br/>
        {printFib(k)}
    </div>
  );
}

function printFib(k)
{
  var fib_val=calculateFib(k);
  return(
    <div>
      wYNIK: {fib_val}
    </div>
  );
}
function calculateFib(k)
{
  if(k==0)
  {
    return 0;
  }
  else if(k==1)
  {
    return 1;
  }
  else if(k>=130 || k<0)
  {
    return;
  }
  else
  {
    return calculateFib(k-1)+calculateFib(k-2);
  }
}

export default Fib;
